 */
"use strict";

const { isBytecodeModule, wrapModule } = require("./bytecode");

function processBytecodeModules(
  modules,
  { filter = () => true, createModuleId, dev, projectRoot }
) {
  return [...modules]
    .filter(isBytecodeModule)
    .filter(filter)
    .map((module) => [
      module,
      wrapModule(module, {
        createModuleId,
        dev,
        projectRoot,
      }),
    ]);
}

module.exports = processBytecodeModules;
